export default[{
    path: '/system',
    name: 'system',
    component: resolve => require(["@/views/index"], resolve),
    children:[
        {
            //用户消息
            path:'/noticeToPerson',
            name:'noticeToPerson',
            component:resolve => require(['@/views/system/noticeToPerson.vue'],resolve),
            meta:{
                title:'修改账号信息'
            }
        },{
            //编辑仓库
            path:'/edit_warehouse',
            name:'edit_warehouse',
            component:resolve => require(['@/views/system/wareHouse_details.vue'],resolve),
            meta:{
                title:'编辑仓库'
            }
        }
    ]
}]
